767 
768       _Iter
769       operator++(int)
770       {
771     _Iter ret(base_type::m_p_nd);
772     operator++();
773     return ret;
774       }
775 
776       _Iter&
777       operator--()
778       {
779     base_type::operator--();
780     return *this;
781       }
782 
783       _Iter
784       operator--(int)
785       {
786     _Iter ret(base_type::m_p_nd);
787     operator--();
788     return ret;
789       }
790     };
