1194     PB_DS_CLASS_T_DEC
1195     void
1196     PB_DS_CLASS_C_DEC::
1197     remove_child(node_pointer p_nd)
1198     {
1199       size_type i = 0;
1200       for (; i < arr_size; ++i)
1201     if (m_a_p_children[i] == p_nd)
1202       {
1203         m_a_p_children[i] = 0;
1204         return;
1205       }
1206       _GLIBCXX_DEBUG_ASSERT(i != arr_size);
1207     }
