1309     PB_DS_CLASS_T_DEC
1310     typename PB_DS_CLASS_C_DEC::size_type
1311     PB_DS_CLASS_C_DEC::
1312     get_begin_pos() const
1313     {
1314       size_type i = 0;
1315       for (; i < arr_size && m_a_p_children[i] == 0; ++i)
1316     ;
1317       return i;
1318     }
